import { useEffect, useState } from "react";
import axios from "axios";
import Layout from "../layout";

function Home() {
  const [product, setProduct] = useState([]);
  useEffect(() => {
    axios
      .post("/product/", { id: "6606dc7ae21fbca9cdb4cd99" })
      .then((res) => setProduct(res.data))
      .catch((err) => console.log(err));
  }, []);
  return (
    <Layout>
      <div className="p-6">
        {product &&
          product.map((banner) => (
            <div key={banner._id} className="text-center">
              <div className="overflow-hidden h-3/6">
                <img
                  className="object-cover scale-150"
                  src={banner.image}
                  alt="banner"
                />
              </div>
              <h2 className="text-5xl font-two uppercase tracking-widest">
                {banner.name}
              </h2>
              <p>{banner.description}</p>
            </div>
          ))}
      </div>
    </Layout>
  );
}

export default Home;
